import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Welcome to CheapETH Faucet.<br></br>

<small>          Where you can get cTH cheap.</small>
        </p>
      </header>
    </div>
  );
}

export default App;
